// Gallery.js

import React from 'react';

const Gallery = () => {
  return (
    <div>
      <h2 className="text-2xl font-bold mb-4">Gambar Utama</h2>
      {/* Tampilkan 4 gambar pulau utama yang responsif di sini */}

      <h2 className="text-2xl font-bold mt-8 mb-4">Gambar Lainnya</h2>
      {/* Tampilkan gambar lainnya di sini */}
    </div>
  );
};

export default Gallery;
